import "bootstrap-icons/font/bootstrap-icons.css"
import Login from "./admin/pages/Login";
import {BrowserRouter, Route, Routes} from "react-router-dom";
import {Dashboard} from "./admin/pages/Dashboard";
import {getUserData, validUser} from "./admin/api/userApiCalls";
import {Editions} from "./admin/pages/Editions";
import {Manage} from "./admin/pages/Manage";
import Editor__chief from "./admin/pages/chief/Editor__chief";
import {Editor} from "./admin/pages/Editor";
import {Editor__redirect} from "./admin/pages/marker/Editor__redirect";

function App() {

  return (
    <BrowserRouter>
      <Routes>
          <Route path={"/"} element={<Login/>}/>
          <Route path={"/password/:token"} element={<Login password={true}/>}/>
          <Route path={"/dashboard"} element={<Dashboard/>}/>
          <Route path={"/manage"} element={<Manage/>}/>
          <Route path={"/editions/:id"} element={<Editions/>}/>
          <Route path={"/editor/:id"} element={<Editor/>}/>
          <Route path={"/editor/:id/:token"} element={<Editor__redirect/>}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
